const AvailableMeals = () => {
  useEffect(() => {
    const fetchMeals = async () => {
    await fetch('https://food-app-ba47e-default-rtdb.firebaseio.com/meals.json');
    };
  }, []);
  return (
  <section className={classes.meals}>
   <Card>
      <ul>
        {DUMMY_MEALS.map((meal) => (
          <MealItem
            id={meal.id}
            key={meal.id}
            name={meal.name}
            description={meal.description}
            price={meal.price}
          />
        ))}
      </ul>
    </Card>
  </section>
  );
}

